import { useParams } from "react-router-dom";

export async function getSingleQuote(itemId) {
    const response = await fetch(`${FIREBASE_DOMAIN}/market/${itemId}.json`);
    const data = await response.json();

    if (!response.ok) {
      throw new Error(data.message || 'Could not fetch quote.');
    }

    const loadedItem = {
      id: itemId,
      ...data,
    };

    return loadedItem;
  }

